    false,nt"url": null,nt"notes": "This annual narrative report for Chautauqua
    National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
    year. The report begins with Refuge highlights and climatic conditions. The planning
    section discusses the management plan, public participation, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh and water birds, shorebirds, raptors, other migratory birds, game
    mammals, other resident wildlife, fisheries resources, and marking and banding.
    The public uses of the Refuge described in this report include interpretive programs,
    outdoor classrooms, hunting, fishing, wildlife observation, other wildlife-oriented
    recreation, picnicking, other non-wildlife oriented recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, equipment utilization and replacement, communications
    systems, computer systems, and energy conservation. Cooperative programs, other
    economic uses, and items of interest are provided at the end. Photographs are attached.
    Narrative report on the Cameron-Billshach Unit of Chautauqua National Wildlife Refuge
    and Meredosia National Wildlife Refuge is included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
